import './Quote.css';
import Media from 'react-media';

// Qoute Component 
export default function ReturnQuote() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
}

export const ScreenLarge = () => (
 <div className='wrp-quote-delete'>
  <ViewText />
 </div>
);
export const ScreenMedium = () => (
 <div className='wrp-quote-delete-md'>
  <ViewText />
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-quote-delete-sm'>
  <ViewText />
 </div>
);

export const ViewText = () => (
 <p>
  Une demande de suppression est en cours de traitement
  pour le numéro affiché en ce moment, voulez-vous terminer
  le processus. Utilisez le bouton ci-dessous
 </p>
);
